import React, { Component } from "react";
import { connect } from "react-redux";
import { fetchAssetDevices } from "../store/actions";

class TowerDetail extends Component {
  componentDidMount() {
    this.props.fetchAssetDevices({
      assetId: this.props.id,
      type: this.props.type,
    });
  }
  componentWillUnmount() {
    this._isMounted = false;
  }
  render() {
    console.log(this.props.devices);
    return (
      <div className="card tower-info">
        <div className="card-body">
          <h5 className="card-title">Special title treatment</h5>
          <p className="card-text">
            With supporting text below as a natural lead-in to additional
            content.
          </p>
          <a href="#" className="btn btn-primary">
            Go somewhere
          </a>
        </div>
      </div>
    );
  }
}
const mapStateToProps = ({ AssetDevicesReducer }) => {
  return {
    devices: AssetDevicesReducer.data,
  };
};

export default connect(mapStateToProps, {
  fetchAssetDevices,
})(TowerDetail);
